import React from "react";

const Footer = () => {
  return (
    <FooterContainer>
      <FooterWrap>
        <FootLinksContainer>
          <FooterLinksWrapper>
            <FooterLinkItems>
              <FooterLinkTitle>Social Media</FooterLinkTitle>
              <FooterLink to="/signin">Instagram</FooterLink>
              <FooterLink to="https://www.facebook.com/KandR5STAREVENTS">
                Facebook
              </FooterLink>
              <FooterLink to="/signin">Youtube</FooterLink>
              <FooterLink to="/signin">Twitter</FooterLink>
            </FooterLinkItems>
          </FooterLinksWrapper>
        </FootLinksContainer>
      </FooterWrap>
    </FooterContainer>
  );
};

export default Footer;
